import asyncio

from seed import (
    AsyncSeedPythonPositionalSingleProperty,
    BondSingleLeg,
    Isin,
    Quantity,
    TakerParty,
    Trader,
)

client = AsyncSeedPythonPositionalSingleProperty(
    base_url="https://yourhost.com/path/to/api",
)


async def main() -> None:
    await client.create(
        instrument=BondSingleLeg(
            identifier=Isin(
                isin="US0378331005",
            ),
            quantity=Quantity(
                quantity=10000.0,
            ),
        ),
        taker=TakerParty(
            trader=Trader(
                uuid_=1234567,
            ),
        ),
    )


asyncio.run(main())
